import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

/**
 * Navbar
 */
function Nav() {
  return (
    <nav className="navBar">
      <ul className="navButtons">
        <Link to="/Myslibros">
            <li>Home</li>
        </Link>
        <li>Myslibros</li>
      </ul>
    </nav>
  );
}

export default Nav;
